// src/pages/CreateUser.jsx
import React, { useState } from 'react';
import { useDispatch } from 'react-redux';

import { useNavigate } from 'react-router-dom';
import { createUser } from '../features/users/userThunks';

const CreateUser = () => {
    const dispatch = useDispatch();
    const navigate = useNavigate();

    const [formData, setFormData] = useState({
        username: '',
        password: '',
        email: '',
    });

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        const{username,email,password}=formData
       dispatch(createUser({username,email,password}));
        navigate('/users');
    };

    return (
        <div>
            <h2>Create User</h2>
            <form onSubmit={handleSubmit}>
                <input name="username" value={formData.username} onChange={handleChange} placeholder="User Name" />
                <input name="password" value={formData.password} onChange={handleChange} placeholder="Password" />
                <input name="email" value={formData.email} onChange={handleChange} placeholder="Email" />
                <button type="submit">Create</button>
            </form>
        </div>
    );
};

export default CreateUser;
